import './Navbar.css';
import {Link} from "react-router-dom";

function Navbar() {
  return (
    <div className="navbar">
        <div className="navbar_link">
          <div>
              <div>
                <ul>
                  <Link>

                  </Link>
                </ul>
              </div>
          </div>

        </div>
    </div>
  );
}

export default Navbar;
